// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import './App.css';

function App() {
  return (
    <Router>
      <div className='App'>
        <Routes>
          <Route path="/" element={<Main />} />
          <Route path="/sc" element={<StandUp/>} />
          <Route path="/lc" element={<Live/>} />
          <Route path="/ce" element={<Cultural/>} />
          <Route path="/sc" element={<Sports/>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
